INSERT INTO `ps_category_lang` (`id_category`, `id_shop`, `id_lang`, `name`, `description`, `link_rewrite`, `meta_title`, `meta_keywords`, `meta_description`) VALUES
(1, 1, 1, 'Root', '', 'root', '', '', ''),
(2, 1, 1, 'Beranda', '', 'beranda', '', '', ''),
(10, 1, 1, 'COMPASS', '<p style=\"text-align:justify;\">Compass memulai awal yang sederhana pada tahun 1998, sebagai bisnis keluarga kecil di Bandung. Dua dekade kemudian, Compass terlahir kembali dengan sentuhan kontemporer yang segar, sambil tetap mempertahankan sejarahnya; campuran yang solid dari desain vintage klasik dan pendekatan pop modern. Garis samping tanda tangan, melambangkan Gazelle yang berjalan dalam penerbangan penuh  menandakan kepercayaan merek pada daya tahan dan dorongan untuk terus bergerak maju.</p>', 'compass', '', '', ''),
(11, 1, 1, 'PATROBAS', '<p style=\"text-align:justify;\">Kami memutuskan untuk mendirikan PATROBAS pada tahun 2014 untuk menjawab permasalahan yang saat itu sering dijumpai di masyarakat, yaitu banyaknya produk sepatu berkualitas namun dibandrol dengan harga yang relatif tinggi, Dari dahulu hingga sekarang PATROBAS secara konsisten menjunjung tinggi nilai \"Price and Benefit\", yang berarti dengan harga yang terjangkau (Price) kalian bisa mendapatkan sepatu berkualitas yang bernilai jauh diatas dari yang kalian bayarkan (Benefit). Filosofi Price and Benefit tersebut kami terjemahkan menjadi logo berinisial P &amp; B, dan juga lengkungan stripe logo Patrobas. Tentunya, seluruh karya yang dihasilkan berasal dari material dan tangan pengrajin terbaik dalam negeri</p>', 'patrobas', '', '', ''),
(12, 1, 1, 'JOHNSON', '<p style=\"text-align:justify;\">Salah satu brand sepatu lokal asal Bandung Indonesia yang berdiri sejak 2019. Brand ini mengusung konsep #GayaGaPakeMahal karena ingin menciptakan sepatu berkualitas dengan harga yang pas dikantong semua kalangan. Harga murah bukan berarti murahan.</p>\r\n<p style=\"text-align:justify;\"></p>\r\n<p style=\"text-align:justify;\">#GayaPakeGaMahal</p>', 'johnson', '', '', ''),
(13, 1, 1, 'Gazelle Hi', '', 'gazelle-hi', '', '', ''),
(14, 1, 1, 'Gazelle Low', '', 'gazelle-low', '', '', ''),
(15, 1, 1, 'Gazelle \'98 Vintage', '', 'gazelle-98-vintage', '', '', ''),
(16, 1, 1, 'Equip', '<p>Equip ini merupakan Salah satu kategori yang ada di Sepatu Compass</p>', 'equip', '', '', ''),
(17, 1, 1, 'Hugo', '', 'hugo', '', '', ''),
(18, 1, 1, 'Hawk', '', 'hawk', '', '', ''),
(19, 1, 1, 'High Cut', '', 'high-cut', '', '', ''),
(20, 1, 1, 'Low Cut', '', 'low-cut', '', '', ''),
(21, 1, 1, 'Slip On', '', 'slip-on', '', '', '');
