INSERT INTO `ps_cms_lang` (`id_cms`, `id_lang`, `id_shop`, `meta_title`, `head_seo_title`, `meta_description`, `meta_keywords`, `content`, `link_rewrite`) VALUES
(1, 1, 1, 'Pengiriman barang', '', 'Tata cara pengiriman barang', 'pengiriman barang', '<h2>Pengiriman barang</h2>\r\n<h3>Pengiriman paket Anda</h3>\r\n<p>Paket umumnya dikirim dalam waktu 2 hari setelah menerima pembayaran dan dikirim melalui Ekspedisi dengan pelacakan dan pengantaran tanpa tanda tangan. Jika Anda lebih suka pengiriman oleh Ekspedisi Extra dengan tanda tangan yang diperlukan, biaya tambahan akan diterapkan, jadi silakan hubungi kami sebelum memilih metode ini. Apa pun pilihan pengiriman yang Anda buat, kami akan memberi Anda tautan untuk melacak paket Anda secara online.</p>\r\n<p>Biaya pengiriman termasuk biaya penanganan dan pengepakan serta biaya ongkos kirim. Biaya penanganan tetap, sedangkan biaya transportasi bervariasi sesuai dengan berat total pengiriman. Kami menyarankan Anda untuk mengelompokkan barang-barang Anda dalam satu pesanan. Kami tidak dapat mengelompokkan dua pesanan berbeda yang ditempatkan secara terpisah, dan biaya pengiriman akan berlaku untuk masing-masing. Paket Anda akan dikirim dengan risiko Anda sendiri, tetapi perawatan khusus diambil untuk melindungi benda-benda yang rapuh. Kotak berukuran cukup besar dan barang-barang Anda terlindungi dengan <br />baik.</p>', 'pengiriman-barang'),
(2, 1, 1, 'Kebijakan privasi dan hukum', '', 'Kebijakan privasi dan hukum', 'notice, legal, credits', '<h2>Kebijakan privasi dan hukum</h2>\r\n<p>Situs web dan/atau aplikasi ini (AKAL Pride) dikelola dan dioperasikan oleh PT Global Digital Niaga dan afiliasinya (Perusahaan atau Kami). Dalam menjalankan dan mengelola situs ini, Perusahaan menerapkan Kebijakan Privasi untuk menetapkan tata cara perlindungan dan penggunaan informasi yang Anda berikan ketika menggunakan layanan situs ini.</p>\r\n<p>Kami berkomitmen untuk memastikan bahwa privasi Anda dilindungi. Bila Kami meminta Anda untuk memberikan informasi tertentu yang dapat diidentifikasi ketika menggunakan situs dan/atau aplikasi ini, maka informasi tersebut itu hanya akan digunakan sesuai dengan pernyataan privasi ini.</p>\r\n<p>Kebijakan Privasi ini meliputi proses perolehan, pengelolaan, penggunaan, perlindungan yang berhubungan dengan informasi dan data pribadi pengguna berdasarkan aturan perundang-undangan yang berlaku di wilayah Negara Kesatuan Republik Indonesia dan standar keamanan informasi yang bersifat global. Dalam proses peningkatan layanan kami, Kebijakan Privasi bisa berubah atau diperbaharui sewaktu-waktu tanpa ada pemberitahuan dan/atau pengumuman terlebih dahulu.</p>\r\n<p>Dengan mengakses dan menggunakan layanan pada Situs dan Aplikasi Blibli, Anda dianggap telah membaca, memahami, dan memberikan persetujuan kepada Kami atas pengumpulan, pemrosesan, pengungkapan, dan penggunaan informasi dan juga data pribadi Anda.</p>\r\n<p></p>', 'kebijakan-privasi-dan-hukum'),
(3, 1, 1, 'Syarat pemakaian', '', 'Syarat pemakaian', 'conditions, terms, use, sell', '<h2>Syarat dan ketentuan pemakaian</h2>\r\n<p>KONDISI PENGGUNAAN</p>\r\n<p>Toko online Sepatu Compass ditawarkan kepada Anda, pengguna, yang dikondisikan pada penerimaan Anda atas syarat, ketentuan, dan pemberitahuan yang terkandung atau dimasukkan oleh referensi di sini dan syarat dan ketentuan tambahan, perjanjian, dan pemberitahuan yang mungkin berlaku untuk halaman atau bagian situs mana pun.</p>\r\n<p><span>KONDISI PENGEMBALIAN</span></p>\r\n<ul style=\"list-style-type:square;\">\r\n<li><span>Item harus dikembalikan dalam waktu 3 hari sejak tanggal diterima</span></li>\r\n<li>Item harus dalam kondisi asli</li>\r\n<li>Item harus memiliki semua tag terpasang</li>\r\n<li><span>Item penjualan tidak memenuhi syarat untuk pengembalian</span></li>\r\n</ul>\r\n<p></p>', 'syarat-pemakaian'),
(4, 1, 1, 'Tentang kami', '', 'Lebih lanjut mengenai kami', 'about us, informations', '<h2>Alas Kaki Lokal Pride</h2>\r\n<p><strong>Alas Kaki Lokal Pride Store</strong>Merupakan toko Online yang menyediakan berbagai macam sepatu lokal yang ada di Indonesia dengan grade ORIGINAL, dengan brand yang terpercaya kualitasnya seperti<strong>Compass, Patrobass, dan Johnson</strong>dengan berbagai model dan ukuran.</p>', 'tentang-kami'),
(5, 1, 1, 'Pembayaran', '', 'Pembayaran', 'secure payment, ssl, visa, mastercard, paypal', '<h2>Pembayaran</h2>\r\n<p>Detail tentang pembayaran</p>\r\n<p>Pembayaran Dilakukan dengan 2 Cara Yaitu :</p>\r\n<ul style=\"list-style-type:square;\">\r\n<li>Via Transfer</li>\r\n<li>Via Cek</li>\r\n</ul>', 'pembayaran');
