INSERT INTO `ps_manufacturer_lang` (`id_manufacturer`, `id_lang`, `description`, `short_description`, `meta_title`, `meta_keywords`, `meta_description`) VALUES
(3, 1, '<p>Compass memulai awal yang sederhana pada tahun 1998, sebagai bisnis keluarga kecil di Bandung. Dua dekade kemudian, Compass terlahir kembali dengan sentuhan kontemporer yang segar, sambil tetap mempertahankan sejarahnya; campuran yang solid dari desain vintage klasik dan pendekatan pop modern. Garis samping tanda tangan, melambangkan Gazelle yang berjalan dalam penerbangan penuh  menandakan kepercayaan merek pada daya tahan dan dorongan untuk terus bergerak maju.</p>', '<p>Compass memulai awal yang sederhana pada tahun 1998, sebagai bisnis keluarga kecil di Bandung.</p>', '', '', ''),
(4, 1, '<p>PATROBAS didirikan pada tahun 2014 untuk menjawab permasalahan yang saat itu sering dijumpai di masyarakat, yaitu banyaknya produk sepatu berkualitas namun dibandrol dengan harga yang relatif tinggi. Dari dahulu hingga sekarang PATROBAS secara konsisten menjunjung tinggi nilai \"Price and Benefit\", yang berarti dengan harga yang terjangkau (Price) kalian bisa mendapatkan sepatu berkualitas yang bernilai jauh diatas dari yang kalian bayarkan (Benefit). Filosofi Price and Benefit tersebut kami terjemahkan menjadi logo berinisial P &amp; B, dan juga lengkungan stripe logo Patrobas Tentunya, seluruh karya yang dihasilkan berasal dari material dan tangan pengrajin terbaik dalam negeri</p>', '<p>PATROBAS didirikan pada tahun 2014 untuk menjawab permasalahan yang saat itu sering dijumpai di masyarakat, yaitu banyaknya produk sepatu berkualitas namun dibandrol dengan harga yang relatif tinggi.</p>', '', '', ''),
(5, 1, '<p>Salah satu brand sepatu lokal asal Bandung Indonesia yang berdiri sejak 2019. Brand ini mengusung konsep #GayaGaPakeMahal karena ingin menciptakan sepatu berkualitas dengan harga yang pas dikantong semua kalangan. Harga murah bukan berarti murahan.</p>', '<p>Salah satu brand sepatu lokal asal Bandung Indonesia yang berdiri sejak 2019.</p>', '', '', '');
